import './App.css';
import { Routes, Route, Link } from "react-router-dom"
import Home from './components/Home';

function App() {
  return (
    <div className="App">
      <header>
        <h1>
          <Link to="/">Home</Link>
        </h1>
      </header>
      <main>


      <Routes>
        <Route path='/' element={<Home/>}/>
      </Routes>
      </main>
    </div>
  );
}

export default App;
